1.        העותר יליד 2004, תושב בית רימא, נעצר ביום 22.2.2024, ונחקר על ידי משטרת
ישראל בחשד לפגיעה בביטחון; לחברות לפעילות ולמתן שירות לארגון עוין חמאס;
ולהשתתפות בהפרות סדר, אך הכחיש את כל המיוחס לו.

אקדים אחרית לראשית
ואציין כי לאחר שעיינתי בבקשה לרשות ערעור, באתי לכלל מסקנה כי דינה להידחות;
ואסביר.
